import styled from 'styled-components'

export const HomeFixedHeaderComponentWrapper = styled.div`
  .search-icon-wrapper {
    color: var(--dark-dwed);
    display: flex;
    justify-content: center;
    align-items: center;

    svg {
      width: 24px;
      height: 24px;
    }
  }
`

export const OrgSearchInputWrapper = styled.div`
  position: relative;

  input {
    height: 30px;
  }

  svg {
    position: absolute;
    right: 0;
    width: 16px;
    height: 16px;
  }
`
